import React, {Component} from 'react';
import PropTypes from 'prop-types';
import { Navbar, Nav, NavItem} from 'react-bootstrap';
import {Link} from 'react-router-dom';
import './image.css';

/**
 * ComponentName
 */
export class Navigationbar extends Component { // eslint-disable-line react/prefer-stateless-function
  render() {
        if(this.props.isloggedin)
        {
             return (
               <Navbar bg="dark">
                     <h1 style={textStyle}>Welcome to my Meme Genorator</h1>
                     <Nav.Link href="/"><h2 style={linkStyle}>Home</h2></Nav.Link>
                     <Nav.Link href="saved" ><h2 style={linkStyle}>Saved</h2></Nav.Link>

               </Navbar>
             );
       }
    return (
      <Navbar bg="dark">
            <h1 style={textStyle}>Welcome to my Meme Genorator</h1>
            <Nav.Link href="/"><h2 style={linkStyle}>Home</h2></Nav.Link>
            <Nav.Link href="login"><h2 style={linkStyle}>Login/Register</h2></Nav.Link>

      </Navbar>
    );
  }
}


Navbar.propTypes = {
  isloggedin: PropTypes.bool.isRequired
}
const textStyle = {
      color:"white",
      fontFamily: "Andale Mono"
}
const linkStyle={
      color:"white",
      size:"100px",
      border: '10px',
      padding: '5px 8px',
      fontFamily: "Andale Mono"

}
export default Navigationbar;

